import React from 'react'

const UsersMessages = () => {
    return (
        <div>
            {username === chatUser ? (
               <div className="chat-user-side">
                    <h1></h1>
                    <h1></h1>
                </div>
            ) : (
                <div className="user-side">
                    <h1>Ez</h1>
                    <h1>Ez</h1>
                </div>
            )}
       </div>
    )
}

export default UsersMessages
